import Slider from "react-slick";

import React, { Component } from 'react'
import CartMyStyden from "./CartMyStyden";

export default class MyStudent extends Component {
    render() {
        let { course } = this.props
        const settings = {
            dots: true,
            nav: true,
            infinite: true,
            slidesToShow: 5,
            slidesToScroll: 1,
            autoplay: true,
            speed: 3000,
            autoplaySpeed: 3000,
            cssEase: "linear"
        };
        return (
            <section className="Mystudent">
                <div className="student_content container ">
                    <h3>Students are viewing</h3>
                    <div className="student_course ">

                        <Slider {...settings}  >
                            <CartMyStyden course={this.props.course} />

                        </Slider>

                    </div>
                </div >
            </section >

        )
    }
}
